script: |
  super -f text -I q11410.spq | sort > q11410.out

inputs:
  - name: q11410.spq
    data: |
      SELECT DISTINCT + 92 / + col2 * + col2 * 3 * - 32 * - 43 AS col1 FROM tab1 (FORMAT parquet) WHERE ( + 52 ) - - + CAST ( NULL AS INTEGER ) IS NULL AND NULL NOT BETWEEN col1 * - - 37 AND ( + col0 );
  - name: tab1

outputs:
  - name: q11410.out
    data: |
